CREATE TABLE medico (
	codigo_medico INT(8) NOT NULL,
	hora_entrada TIME NOT NULL,
	hora_salida TIME NOT NULL,
	CHECK(hora_salida > hora_entrada),
	horario VARCHAR(50) AS (CONCAT(hora_entrada, '-', hora_salida)),
	id_dni_personal INT(8) NOT NULL,
	codigo_especialidad INT NOT NULL,
	PRIMARY KEY(codigo_medico),
	CONSTRAINT FK_id_dni_personal FOREIGN KEY(id_dni_personal) REFERENCES personal(id_dni),
	CONSTRAINT FK_codigo_especialidad FOREIGN KEY(codigo_especialidad) REFERENCES especialidad(codigo_especialidad),
	UNIQUE(codigo_medico)
) ENGINE=INNODB;

