CREATE TABLE lector_asistencia (
	id INT AUTO_INCREMENT NOT NULL,
	dni_medico INT(8) NOT NULL,
	fecha DATE NOT NULL,
	hora TIME NOT NULL,
	PRIMARY KEY(id),
	CONSTRAINT FK_dni_medico FOREIGN KEY(dni_medico) REFERENCES medico(codigo_medico),
	UNIQUE(id)
) ENGINE=INNODB;

