CREATE TABLE citas (
	codigo_cita INT AUTO_INCREMENT NOT NULL,
	dni_paciente INT(8) NOT NULL,
	codigo_especialidad INT NOT NULL,
	fecha DATETIME NOT NULL,
	dni_medico INT(8) NOT NULL,
	turno INT NOT NULL,
	nro_orden INT NOT NULL,
	PRIMARY KEY(codigo_cita),
	CONSTRAINT FK_dni_paciente_c FOREIGN KEY(dni_paciente) REFERENCES paciente(id_dni),
	CONSTRAINT FK_codigo_especialidad_c FOREIGN KEY(codigo_especialidad) REFERENCES especialidad(codigo_especialidad),
	CONSTRAINT FK_dni_medico_c FOREIGN KEY(dni_medico) REFERENCES medico(id_dni_personal),
	CONSTRAINT FK_turno_c FOREIGN KEY(turno) REFERENCES turno(codigo_turno)
) ENGINE=INNODB;

