CREATE TABLE historial_clinico (
	id_historial INT(6) NOT NULL,
	dni_medico INT(8) NOT NULL,
	dni_paciente INT(8) NOT NULL,
	fecha_redaccion DATETIME NOT NULL,
	codigo_especialidad INT NOT NULL,
	tipo_sangre VARCHAR(3) NOT NULL,
	peso FLOAT NOT NULL,
	talla FLOAT NOT NULL,
	presion FLOAT NOT NULL,
	observaciones TEXT NOT NULL,
	PRIMARY KEY(id_historial),
	CONSTRAINT FK_dni_medico_hc FOREIGN KEY(dni_medico) REFERENCES medico(codigo_medico),
	CONSTRAINT FK_dni_paciente_hc FOREIGN KEY(dni_paciente) REFERENCES paciente(id_dni),
	CONSTRAINT FK_codigo_especialidad_hc FOREIGN KEY(codigo_especialidad) REFERENCES especialidad(codigo_especialidad),
	UNIQUE(id_historial)
) ENGINE=INNODB;

CREATE TABLE asistencia (
	id INT NOT NULL,
	id_lector INT NOT NULL,
	turno VARCHAR(20) NOT NULL,
	hora_llegada TIME NOT NULL,
	hora_salida TIME NOT NULL,
	CHECK (hora_salida > hora_llegada),
	tardanza TIME AS (TIMEDIFF(hora_salida, hora_llegada)),
	PRIMARY KEY(id),
	CONSTRAINT FK_id_lector FOREIGN KEY(id_lector) REFERENCES lector_asistencia(id),
	UNIQUE(id)
) ENGINE=INNODB;

CREATE TABLE rol (
	id_rol INT AUTO_INCREMENT NOT NULL,
	nombre_rol VARCHAR(40) NOT NULL,
	PRIMARY KEY(id_rol)
) ENGINE=INNODB;

