CREATE TABLE usuario_rol (
	id_rol INT NOT NULL,
	id_usuario INT NOT NULL,
	CONSTRAINT FK_id_rol FOREIGN KEY(id_rol) REFERENCES rol(id_rol),
	CONSTRAINT FK_usuario_rol FOREIGN KEY(id_usuario) REFERENCES usuario(id_usuario)
